class Solution {

    /**
     * 2948. Make Lexicographically Smallest Array by Swapping Elements
     * This version is so much faster and more simple than mine! And I used ChatGPT!
     * @param Integer[] $nums
     * @param Integer $limit
     * @return Integer[]
     */   
    
    public $nums;

    function fix($numbers, $keys) {
        sort($keys);
        foreach ($keys as $i => $key) {
            $this->nums[$key] = $numbers[$i];
        }
    }
    
    function lexicographicallySmallestArray($nums, $limit) {
        $this->nums = $nums;
        $temp = $nums;
        asort($temp);
        $last = current($temp);
        $numbers = [];
        $keys = [];

        foreach ($temp as $key => $num) {
            if ($num - $last > $limit) {
                if (count($numbers) > 1) { $this->fix($numbers, $keys); }
                $numbers = [];
                $keys = [];
            }
            $numbers[] = $num;
            $keys[] = $key;
            $last = $num;
        }

        $this->fix($numbers, $keys);

        return $this->nums;
    }
}

